DROP FUNCTION IF EXISTS lapsed.insert_pank_data();

CREATE FUNCTION lapsed.insert_pank_data()
    RETURNS INTEGER
    LANGUAGE plpgsql
AS
$$
DECLARE
    v_vn        RECORD;
    l_count     INTEGER = 0;
    l_rekv_id   INTEGER;
    l_laps_id   INTEGER;
    l_va_id     INTEGER;
    l_asutus_id INTEGER;
BEGIN
    FOR v_vn IN
        SELECT *
        FROM tmp_pank
        WHERE vn IN (SELECT viitenumber FROM lapsed.viitenr)
        LOOP
            l_rekv_id = (SELECT id FROM ou.rekv WHERE nimetus LIKE v_vn.regkood || '%' AND parentid = 119 LIMIT 1);
            l_laps_id = (SELECT l.id
                         FROM lapsed.cur_lapsed l
                                  INNER JOIN lapsed.viitenr vn ON l.isikukood = vn.isikukood
                         WHERE vn.viitenumber = v_vn.vn
                         ORDER BY id DESC
                         LIMIT 1);
            IF l_rekv_id IS NULL OR l_laps_id IS NULL
            THEN
                RAISE EXCEPTION 'Puudub andmed l_rekv_id %, l_laps_id %, v_vn.vn %',l_rekv_id, l_laps_id, v_vn.vn;
            END IF;

            l_va_id = (SELECT id
                       FROM lapsed.vanem_arveldus
                       WHERE parentid = l_laps_id
                         AND asutusid IN (SELECT id FROM libs.asutus WHERE regkood = v_vn.ik)
                         AND rekvid = l_rekv_id
                       LIMIT 1);
            IF l_va_id IS NOT NULL
            THEN
                UPDATE lapsed.vanem_arveldus
                SET properties = coalesce(properties, '{}')::JSONB ||
                                 jsonb_build_object('pank', v_vn.pank, 'iban', v_vn.aa)
                WHERE parentid = l_laps_id
                  AND asutusid IN (SELECT id FROM libs.asutus WHERE regkood = v_vn.ik)
                  AND rekvid = l_rekv_id;
            ELSE
                l_asutus_id = (SELECT a.id
                               FROM libs.asutus a
                                        INNER JOIN lapsed.vanemad v ON a.id = v.asutusid
                               WHERE regkood = v_vn.ik
                                 AND v.parentid = l_laps_id
                                 AND v.staatus < 3
                               LIMIT 1);

                IF l_asutus_id IS NOT NULL
                THEN
                    INSERT INTO lapsed.vanem_arveldus (parentid, asutusid, rekvid, arveldus, properties)
                    VALUES (l_laps_id, l_asutus_id, l_rekv_id, FALSE,
                            jsonb_build_object('pank', v_vn.pank, 'iban', v_vn.aa));
                END IF;
            END IF;

--            raise notice 'v_vn.ik %, v_vn.aa %, l_laps_id %, l_rekv_id %', v_vn.ik, v_vn.aa, l_laps_id, l_rekv_id;

            l_count = l_count + 1;
        END LOOP;


    RETURN l_count;

END;
$$;

SELECT lapsed.insert_pank_data();

DROP FUNCTION IF EXISTS lapsed.insert_pank_data();
